import { useState } from 'react';

export default function Navbar({ page, setPage }) {
  const [open, setOpen] = useState(false);

  const go = p => {
    setPage(p);
    setOpen(false);
  };

  return (
    <header className="navbar">
      <div className="nav-inner">
        <div className="logo">ARCHONIK</div>

        <button className="hamburger" onClick={() => setOpen(!open)}>
          â˜°
        </button>

        <nav className={`nav-links ${open ? 'open' : ''}`}>
          <button onClick={() => go('home')} className={page === 'home' ? 'active' : ''}>Home</button>
          <button onClick={() => go('about')} className={page === 'about' ? 'active' : ''}>About</button>
          <button onClick={() => go('services')} className={page === 'services' ? 'active' : ''}>Services</button>
          <button onClick={() => go('contact')} className={page === 'contact' ? 'active' : ''}>Contact</button>
        </nav>
      </div>
    </header>
  );
}
